Si,si, como lo lees, os presentamos un pastel SIN harina, súper bajo en calorias y lo mejor? Sabroooosoooooo😍🔥🤫

Queréis saber como se hace? Pues seguir leyendo‼👇📖

Para esta comida vais a necesitar el horno:

🌟 INGREDIENTES 🌟

▪️300 gr de Paraguayos
▪️3 Claras de huevo
▪️150 gr de Almendras
▪️1 sobre de levadura
▪️1 gr de Cúrcuma
▪️3 Dátiles
▪️2 onzas de choco 90%
▪️1 cucharada de Peanut butter 100%
▪️Sirope de Agave (opcional)

🌟 ELABORACIÓN 🌟

⚠️ Ponemos a calentar el horno a 180°⚠️

Bizcocho 🍰
1. Cortamos los paraguayos y los pasamos por la minipimer hasta tener una masa semi liquida (puedes añadir MUY POCA agua para facilitar el proceso)
2. Mezclamos los paraguayos ya procesados con la levadura, las almendras, las claras de huevo y la cúrcuma. Lo pasamos todo por la minipimer
3. Metemos la mezcla en un molde y al horno 25 minutos!

Cobertura 🍫
1. Disolvemos las onzas con agua en el microondas
2. Cortamos los dátiles en trozos pequeños

Huele taaaaan biieeeen🤩🤤🍰🍫‼‼‼

FUSIOOON 👉👈 = Bizcocho + Cobertura 🍰🍫
1. Sacamos el bizcocho del horno, desmoldamos y lo dejamos enfriar unos minutos
2. Cojemos el chocolate disuelto y lo ponemos por encima del bizcocho
3. Añadimos la peanut butter y los dátiles
4. Quieres un bizcocho extra dulce? Añade sirope de agave!🤫🤭

🌟 EMPLATADO 🌟

🍽 Si soys de los que necesitan nata para comerse un trozo de pastel podéis probar esto:
1. Montar una clara a punto de nieve
2. Una vez montada, añadir Stevia 

No es nata pero da el pego!🤭

Yo nose vosotros pero yo, me lo comía entero‼🍰🤭🤫🍫🤤😈
